import React from 'react';
import './App.css';

const App = () => {
  return (
    <div className='app-wrapper'>
      <header className='header'>
        <img height='50px' width='50px' src='data:image/png;base64,'/>
      </header>
      <nav className='nav'>
        <div>Profile</div>
        <div>Messages</div>
        <div>News</div>
        <div>Music</div>
      </nav>
      <div className='content'>ma perf content</div>
    </div>
  );
}

export default App;
